/* eslint-disable react/prop-types */
import React from 'react';
import { Container } from 'styled-container-component';

const Layout = props => {
	const layoutStyle = {
		margin: 20,
		padding: 20,
		border: '1px solid #DDD',
	};
	return (
		<div style={layoutStyle}>
			<p>Top Stories</p>
			{props.children}
		</div>
	);
};

export default Layout;
